__NUXT_JSONP__("/drugs/Globo_H-DT_Vaccine_OBI-833", (function(a,b,c,d){return {data:[{drug:{slug:b,emaEpar:[],fdaDrugLabel:[],id:b,nciThesaurus:{casRegistry:a,chebiId:a,chemicalFormula:a,definition:"A carbohydrate-based vaccine comprised of the Globo H hexasaccharide 1 (Globo H) antigen conjugated to DT-CRM197, a non-toxic, mutated form of diphtheria toxin (DT), with potential immunostimulating and antineoplastic activities. Upon administration of Globo H-DT vaccine OBI-833, the carbohydrate antigen Globo H may stimulate a cytotoxic T-lymphocyte (CTL) response against Globo H-expressing tumor cells, thereby decreasing tumor cell proliferation. The hexasaccharide Globo H is a tumor-associated antigen (TAA) commonly found on a variety of tumor cells. DT-CRM197, also called diphtheria toxin cross-reacting material 197, is used to increase the immunogenicity of the Globo H carbohydrate antigen.",fdaUniiCode:"NC1XBS5AET",identifier:"C119745",preferredName:c,semanticType:"Immunologic Factor",subclassOf:["C1455","C1663"],synonyms:["Globo H-CRM197 Vaccine",c,"OBI-833"]},dir:"\u002Fdrugs",path:"\u002Fdrugs\u002FGlobo_H-DT_Vaccine_OBI-833",extension:".json",createdAt:d,updatedAt:d}}],fetch:{},mutations:void 0}}("","Globo_H-DT_Vaccine_OBI-833","Globo H-DT Vaccine OBI-833","2021-10-30T13:19:54.523Z")));